import React from 'react';
import { useTranslation } from 'react-i18next';

const Process = () => {
    const { t } = useTranslation();

    return (
        <section id="service" className="max-w-screen-2xl mx-auto flex flex-col items-start justify-center text-left my-32 md:my-48 px-8 md:px-16">
            <h2 className='mb-8 text-4xl'>Service</h2>
            <hr className='border-white/10 w-full'></hr>
            <div className="flex flex-col md:flex-row w-full justify-between items-stretch md:gap-8 lg:gap-24">
                <div className="flex flex-col items-start gap-16 py-24 flex-1">
                </div>
                <span className="uppercase text-2xl md:text-base md:leading-6">1 {t('strategy')}</span>
                <p>Hallo</p>
            </div>
            <div className="w-[1px] bg-white/10 hidden md:block"></div>
            <div className="h-[1px] bg-white/10 md:hidden"></div>
            <div className="flex flex-col items-start gap-16 py-24 flex-1">
                <span className="uppercase text-2xl md:text-base md:leading-6">2 Design</span>
                <p>Hallo</p>
            </div>
            <div className="w-[1px] bg-white/10 hidden md:block"></div>
            <div className="h-[1px] bg-white/10 md:hidden"></div>
            <div className="flex flex-col items-start gap-16 py-24 flex-1">
                <span className="uppercase text-2xl md:text-base md:leading-6">3 {t('development')}</span>
                <p>Hallo</p>
            </div>
        </section>
    );
}

export default Process;
